void continuarLeitura(int *current_state, int next_state, int *current_position, int *last_word_ending, int *last_final_state){
    *current_state = next_state;
    (*current_position)++;
    if(verificaFinal(*current_state) != ERRO){
        *last_word_ending = *current_position;
        *last_final_state = *current_state;
    }
}

int resetarLeitura(List *input, char current_input, int last_word_ending, int word_start, int last_final_state, char **word){
    int final_state = ERRO;

    if(last_word_ending != word_start){ // a valid word exists
        word_start = last_word_ending;
        *word = get_word_list(input, last_word_ending);

        final_state = verificaFinal(last_final_state);
    } else{ // caractere não existe no alfabeto
        *word = get_word_list(input, 1);
        word_start++;

        if (current_input <= 0){
            final_state = END_OF_FILE;
        } else if(current_input == 32){
            final_state = WHITE_SPACE;
        }
    }


    remove_list_word(input, word_start);
    return final_state;
}

int change_state(char current_input, int current_state){
    if(current_input <= 0){
        return 0;
    }
    return automata[current_state][current_input-1];
}

int check_automata(int initial_state, FILE *entry, List *input, char **erro){
    int word_start = 0;
    int current_state = initial_state;
    int last_word_ending = word_start;
    int current_position = word_start;
    int last_final_state = 0;
    char current_input = '\0';


    do {
        if(get_list_size(input) == current_position){
            current_input = fgetc(entry);
            insereLista(input, current_input);
        }else{
            current_input = get_list_char(input, current_position);
        }

        int next_state = change_state(current_input, current_state);

        if(next_state == 0 ) { // erro
            return (resetarLeitura(input, current_input, last_word_ending, word_start, last_final_state, erro));

        } else {
            continuarLeitura(&current_state, next_state, &current_position, &last_word_ending, &last_final_state);
        }

    } while (current_input != EOF);

    return END_OF_FILE;
}

int advance(int initial_state, FILE *entry, List *input, int *linha, int *coluna, char **word){
    if(word != NULL){
        char *aux = *word;
        free(aux);
    }

    int token;

    while(1) {
        token = check_automata(initial_state, entry, input, word);
        if (token == QUEBRA_LINHA ) {
            (*coluna) = 1;
            (*linha)++;
            continue;
        } else if (token == COMENTARIO_DE_BLOCO) {
            int i;
            for (i = 0; i < strlen(*word); i++) {
                if ((*word)[i] == '\n') {
                    (*linha)++;
                    (*coluna) = 1;
                } else {
                    (*coluna)++;
                }
            }
            continue;
        } else {
            (*coluna) += strlen(*word);
            if(token == WHITE_SPACE || token == COMENTARIO_DE_LINHA){
                continue;
            } else{
                break;
            }
        }
//    }while(token == WHITE_SPACE);
    }
    return token;
}

